ss=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Pokud máte nějaký\r\nprogram na víkend 14. a 16. března, tak si ho okamžitě zrušte. V tento termín\r\ntotiž letos proběhne již 15. ročník veletrhu For Bikes. Jedná se o největší\r\ncyklistický veletrh, který na našem území můžete zažít. Na letňanském\r\nvýstavišti, kde bude akce probíhat, se můžete těšit na pestrou škálu\r\ncyklistických značek. Díky tomu si zde bude moct prohlédnout všechny nejmodernější\r\ntrendy současné cyklistiky. Na veletrhu nebudeme chybět ani mi se stánkem\r\nobchodu Cycli.</b></p>\r\n\r\n<p class=\"MsoNormal\">Na pražském letňanském výstavišti si budete <b style=\"mso-bidi-font-weight:normal\">moct prohlédnout expozice nejvýznamnějších\r\ntuzemských i<span style=\"mso-spacerun:yes\">&nbsp; </span>zahraničních značek</b>, <span style=\"mso-spacerun:yes\">&nbsp;</span>jež zde představí prezentujících novinky a\r\ntrendy.<span style=\"mso-spacerun:yes\">&nbsp; </span>Návštěvníci budou mít k\r\ndispozici i široké portfolio cyklistického vybavení nebo <b style=\"mso-bidi-font-weight:\r\nnormal\">možnost si vyzkoušet<span style=\"mso-spacerun:yes\">&nbsp; </span>vybrané\r\nmodely kol během testovacích jízd</b>. K&nbsp;dispozici budou i dvě servisní\r\nstanice.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p><p class=\"MsoNormal\">Hlavním důvodem, proč byste na <b>For Bikes měli dorazit je ten, že tam opět budeme my</b>. Pod slovem my si představte <b>růžový stánek obchodu Cycli</b>, v němž budete moct potkat Tomáše. To je sám o sobě dost dobrý důvod pro navštívení nášeho stánku, ale dám vám i další důvody. K vidění bude <b>opět naše SJZ kára</b>. Taky budeme <b>vystavovat prémiová italská kola Officine Mattio</b> a rovněž uspořádáme soutěž v trackstandu.&nbsp; <br></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Novinkou bude v hale 5, kde </b>bude pro návštěvníky k<span style=\"mso-spacerun:yes\"> </span>dispozici Testovací depo elektro kol. <b style=\"mso-bidi-font-weight:normal\">Přímo na výstavišti bude k otestování více\r\nnež pět<span style=\"mso-spacerun:yes\">&nbsp; </span>desítek testovacích elektro kol\r\nvšech typů</b>, a to od značek 4EVER, Agogs, Apache, Bulls,<span style=\"mso-spacerun:yes\"> </span>Cannondale, Corratec, Gioant/LIV, Kellys,\r\nLeader Fox, Levit, Muon, Rock Machine, Scott<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span>Bikes, Tenways, Totem, Vanpowers. </p><h2 class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">PROGRAM</b></h2>\r\n\r\n<p class=\"MsoNormal\">Krom expozic bude celý víkend nabitý doprovodným programem.\r\nBěhem celého víkendu budou návštěvníci veletrhu For Bikes moct testovat\r\nnejrůznější druhy a značky kol. Krom toho bude k&nbsp;dispozici <b style=\"mso-bidi-font-weight:normal\">Sazka Pumptrack zone, kde si účastníci\r\nveletrhu na vlastní kůži vyzkouší jízdu v&nbsp;boulích</b>. Během celého\r\nvíkendu bude k&nbsp;vidění celá řada exhibic, kdy především Freestyle BMX cyklisté\r\nbudou předvádět své umění.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">V sobotu 15. března proběhne <b style=\"mso-bidi-font-weight:\r\nnormal\">závod MTB FOR BIKES, který měří 45 kilometrů </b>a odstartuje<span style=\"mso-spacerun:yes\">&nbsp; </span>v areálu PVA EXPO PRAHA. A kdo si chce ulovit\r\ncenný autogram, dostane příležitost<span style=\"mso-spacerun:yes\">&nbsp; </span>v\r\nsobotu v 15 hodin na stánku THULE, kam <b style=\"mso-bidi-font-weight:normal\">dorazí\r\nza návštěvníky olympionik Ondřej Cink</b>. </p>\r\n\r\n<h2 class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">SPORT EXPO</b></h2>\r\n\r\n<p class=\"MsoNormal\">Významnou novinkou letošního ročníku je souběh s festivalem\r\nSPORT EXPO, který na<span style=\"mso-spacerun:yes\">&nbsp; </span>výstaviště přinese\r\nmožnost poznat na vlastní kůži i další sporty. <b style=\"mso-bidi-font-weight:\r\nnormal\">Návštěvníci si<span style=\"mso-spacerun:yes\">&nbsp; </span>budou moci pod\r\ndohledem odborníků vyzkoušet vzpírání, šerm, judo, aerobik, BMX kola a<span style=\"mso-spacerun:yes\">&nbsp; </span>koloběžky, discgolf nebo skákání přes švihadlo\r\na další</b>. <span style=\"mso-spacerun:yes\">&nbsp;</span>Zájemci mohou také ulovit\r\ncenné autogramy od olympijského<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span>medailisty, šermíře Jiřího Berana, který se zúčastní i slavnostního\r\nzahájení akce. <br></p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">V rámci festivalu <b style=\"mso-bidi-font-weight:normal\">vyroste\r\nv Letňanech SKI365 aréna se speciálním povrchem české výroby</b>,<span style=\"mso-spacerun:yes\">&nbsp; </span><b style=\"mso-bidi-font-weight:normal\">který\r\nklouže jako sníh</b>. V aréně si zájemci si mohou půjčit vybavení a vyzkoušet\r\nsi zimní<span style=\"mso-spacerun:yes\">&nbsp; </span>sporty jako běžkování, biatlon,\r\nlyžování nebo snowboarding a skialpinismus. Instruktoři zde <b style=\"mso-bidi-font-weight:normal\">povedou workshopy pro děti</b> i například\r\nstřelbu z laserové biatlonové střelnice pro dospělé. <br></p><p class=\"MsoNormal\">Čekání na letošní ročník For Bikes si můžete zkrátit zhlédnutím naše videa z loňského roku:</p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/himibQYKtNA?si=7ksCToNbxd0qeJsn\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br><p></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Více informací o\r\nveletrhu naleznete <a href=\"https://forbikes.cz/\" target=\"_blank\">ZDE</a></b></p>\r\n\r\n</div><div><br></div>        ', 6, 'veletrh-for-bikes-2025-prinese-nove-modely-kol-adrenalin-i-prilezitosti-ke-sportovani');